import React from "react";

function Footer({ social }) {
  return (
    <div>
      <h1 className="sub-title font-serif text-4xl md:text-7xl justify-evenly mt-16 font-bold text-center">
        Connect Me On
      </h1>
      <div className="flex flex-wrap gap-11 p-3 mt-10 justify-center mb-16">
        {social.map((user, index) =>
          <div
            key={index}
            className="ro hover:scale-125  transition-all duration-100 rounded-e-3xl rounded-3xl "
          >
            <img
              src={user.image.url}
              alt={user.name}
              className="w-full rounded-3xl "
            />
          </div>
        )}
      </div>
    </div>
  );
}

export default Footer;
